import React from 'react';

const InputPage = () => {
  return (
    <div className="form-group">
      <label htmlFor="formGroupExampleInput">Default input</label>
      <input type="text" className="form-control" id="formGroupExampleInput" />
    </div>
  );
};

export default InputPage;
